import React from 'react';
import styled from 'styled-components';

import { ReactComponent as IconReddit } from '../../static/iconReddit';

const Header = () => (
    <StyleHeader>
        <IconReddit />
    </StyleHeader>
);

export default Header;

const StyleHeader = styled.header`
    background-color: #000;
    height: 300px;
    display: flex;
    align-items: center;
`;
